import React, {Component} from "react";
import {Button, ButtonGroup} from "reactstrap";
import {connect} from "react-redux";

class LocalizeTab extends Component{
    constructor(props) {
        super(props)
    }
    render() {
        console.log(this.props.languages)
        return (
            <ButtonGroup>
                <Button
                    color="success"
                    outline
                >
                    One
                </Button>
                <Button
                    color="success"
                    outline
                >
                    Two
                </Button>
                <Button
                    color="success"
                    outline
                >
                    Three
                </Button>
            </ButtonGroup>

        );
    }
}
const mapStateToProps = state => {
    return {
        languages: state.languages.languages,

    }
};

export default connect(mapStateToProps)(LocalizeTab);
